import React from "react";
import DeleteButton from "./deleteLogic";

const TableRow = ({ item, columns, apiUrl, onDataUpdate }) => {
    return (
        <tr>
            {columns.map((key, index) => (
                <td key={index}>
                    {typeof item[key] === "boolean"
                        ? item[key]
                            ? "Yes"
                            : "No"
                        : item[key]}
                </td>
            ))}
            <td>
                <DeleteButton
                    apiUrl={apiUrl}
                    id={item.id}
                    onDataUpdate={onDataUpdate}
                />
            </td>
        </tr>
    );
};

export default TableRow;
